Frank I agree about the debunkers to let it go. Would they even know if
they captured an EVP themselves or rationalize it all away? Like I said
I have seen & listened to your box live and heard your guys say &quot;Purple
Princess&quot; directly off the box without it being analyzed-this was not
put in a program when I heard it they just came out and said it clear as
day. I knew it was your guys too because they have a different sound to
them then when the spirits Chris was talking to spoke. IMHO if the
debunkers don&#39;t want to believe they lose out as you&#39;re willing to share
something that was supposed to be made and you actually did it & I don&#39;t
care if you got help to make the box-you made it and it works!!!!!
Andrea

-----Original Message-----
From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf
Of Vicki Talbott
Sent: Friday, August 04, 2006 1:54 PM
To: EVP-ITC@yahoogroups.com
Subject: RE: [EVP-ITC] amys back

I&#39;d say that would be your best bet at this point.

Sumption Frank &lt;fsumption@...&gt; wrote: 
Yeah, but this one bitch has made it personal, and I&#39;m taking up the
challenge, but as far as she, maybe I should let it go!?
 Frank 



